<!DOCTYPE html>
<html lang="zh-CN">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>自适应家具图册</title>
    <style>
        /* 基础重置 */
        * {
            box-sizing: border-box;
            margin: 0;
            padding: 0;
            font-family: 'Microsoft YaHei', sans-serif;
        }

        /* 打印容器设置 */
        body {
            padding: 1.5cm;
            background: #fff;
        }

        /* 产品容器 */
        .product-set {
            /* page-break-inside: avoid; */
            margin-bottom: 2cm;
            border: 1px solid #ddd;
            padding: 1cm;
            break-inside: avoid-page;
        }

        /* 智能图片网格 */
        .image-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
            grid-auto-rows: minmax(200px, auto);
            grid-gap: 1cm;
            align-items: center;
            justify-content: center;
            margin: 1cm 0;
        }

        /* 图片容器 */
        .image-container {
            position: relative;
            border: 1px solid #eee;
            padding: 0.5cm;
            max-width: 100%;
            height: auto;
            page-break-inside: avoid;
        }

        /* 自适应图片 */
        .adaptive-image {
            width: 100%;
            height: auto;
            max-height: 400px; /* 控制最大打印高度 */
            object-fit: contain;
            display: block;
            margin: 0 auto;
        }

        /* 图片标注 */
        .image-caption {
            position: absolute;
            bottom: 0;
            left: 0;
            right: 0;
            padding: 0.5cm;
            text-align: center;
            font-size: 14px;
        }

        /* 参数表格优化 */
        .spec-table {
            width: 100%;
            border-collapse: collapse;
            margin-top: 1.5cm;
            table-layout: fixed;
        }

        .spec-table td {
            padding: 0.8cm;
            border: 1px solid #ddd;
            vertical-align: top;
            word-break: break-word;
        }

        .spec-table td:first-child {
            width: 30%;
            background: #f8f9fa;
            font-weight: bold;
        }

        /* 打印优化 */
        @media print {
            body {
                padding: 0.7cm !important;
            }
            
            .product-set {
                border: none;
                padding: 0.5cm !important;
            }
            
            .adaptive-image {
                max-height: 250px !important;
            }
            
            .image-caption {
                background: transparent;
                font-size: 12pt;
            }
            
    
    
            .product-title {
                font-size: 18pt; /* 标题缩小 */
                margin-bottom: 0.5cm;
            }
        }
    </style>
</head>
